import Styled from 'styled-components'

const Input = Styled.input`
    width: 6em;
    height: 3em;
    font-size: 2em;
    display: block;
    margin-bottom: 10%;
    margin-top 3%;
    border-radius: 10px;
    border: 1px solid palevioletred;
`

export default Input
